        <form className="ml-auto flex items-center w-full">
          <div className="flex justify-between w-full text-white">
          <div>test</div>
          <div>Bruno Reis do Carmo<span className="w-1 h-1 mx-1.5 bg-gray-500 rounded-full dark:bg-gray-400"></span>
          bruno.reis.carmo@gmail.com</div>
          </div>
        </form>
      </header>
    </div>
  );
};
